          }

    }


    render() {
        return (
            <div id="formoutline">
                <h5>Employee Login</h5>
                <form>
                    <input className="login" id="emailInput" placeholder="Email"></input>
                    <input className="login" id="passwordInput" placeholder="Password"></input>
                </form>
                <button id="submit" onClick={(e) => this.handleSubmitAuth(e)} >Submit</button>
            </div>
